import React, { Component } from 'react'
import {Form,Row,Col,Button} from 'react-bootstrap';

export class Dataform extends Component {

    constructor(props) {
        super(props)

        this.state = {
            amount: '',
            duration: ''
          }
    }

    render() {
        return (
            <div>
          <Form onSubmit={this.handleSubmit}>
          <div className="Form-data">
          <Row>
            <Col sm={5}>
            <label for="inputAmount">Amount</label>
              <input type="text" name="Amount" id="inputAmount" onChange={this.handleChangeAmount} />
            </Col>
            <label for="inputDuration">Duration</label>
            <Col sm={5}>

              <input type="text" id="inputDuration" name="Duration" onChange={this.handleChangeDuration} />
            </Col>
            <Col sm={2}>
              <Button type="submit" variant="warning">OK</Button>
            </Col>            
          </Row>
          </div>
        </Form>
            </div>
        )
    }
}

export default Dataform
